WITH date_filter AS (SELECT d_date_sk FROM date_dim WHERE d_date BETWEEN '1999-2-01' AND (CAST('1999-2-01' AS DATE) + INTERVAL 60 DAY)), ca_filter AS (SELECT ca_address_sk FROM customer_address WHERE ca_state = 'NC'), web_filter AS (SELECT web_site_sk FROM web_site WHERE web_company_name = 'pri'), prefetch_ws AS (SELECT ws1.ws_order_number, ws1.ws_ext_ship_cost, ws1.ws_net_profit FROM web_sales ws1 JOIN date_filter ON ws1.ws_ship_date_sk = date_filter.d_date_sk JOIN ca_filter ON ws1.ws_ship_addr_sk = ca_filter.ca_address_sk JOIN web_filter ON ws1.ws_web_site_sk = web_filter.web_site_sk), ws_wh AS (SELECT ws1.ws_order_number FROM web_sales ws1, web_sales ws2 WHERE ws1.ws_order_number = ws2.ws_order_number AND ws1.ws_warehouse_sk <> ws2.ws_warehouse_sk), semi_join1 AS (SELECT ws_order_number, ws_ext_ship_cost, ws_net_profit FROM prefetch_ws WHERE ws_order_number IN (SELECT ws_order_number FROM ws_wh)), semi_join2 AS (SELECT ws_order_number, ws_ext_ship_cost, ws_net_profit FROM semi_join1 WHERE ws_order_number IN (SELECT wr_order_number FROM web_returns WHERE wr_order_number IN (SELECT ws_order_number FROM ws_wh))) SELECT COUNT(DISTINCT ws_order_number) AS "order count", SUM(ws_ext_ship_cost) AS "total shipping cost", SUM(ws_net_profit) AS "total net profit" FROM semi_join2 ORDER BY COUNT(DISTINCT ws_order_number) LIMIT 100